import React from 'react';
import '../../App.css';
import './Pages.css';


function Home()
{
	return (
		<div className='mainSection'>
			<div className='row h-100'>
				<div className='col-md-12 text-center my-auto'>
					<h1>HOME</h1>
				</div>
			</div>
		</div>

	);
}

export default Home;
